import React from 'react';
import { Link } from 'react-router-dom';

const nav = {
    background: 'cyan',
    // display: 'flex',
    // justifyContent: 'center',
    // alignItems: 'center',
}

const navLinks = {
    background: 'red',
    // display: 'flex',
    // justifyContent: 'center',
    // alignItems: 'center',
}

const links = {
    background: 'green',
    margin: '0 3vw',
}

const linkText = {
    // background: 'yellow',
    width: '14vw',
    textDecoration: 'none',
    color: 'white',
}

function BottomNav() {
    return (
        <nav style={ nav }>
            <ul style={ navLinks }>
                <Link style={links} to='/'>
                    <div style={ linkText }>HOME</div>
                </Link>
                <Link style={links} to='/about'>
                    <div style={ linkText }>ABOUT</div>
                </Link>
                <Link style={links} to='/services'>
                    <div style={ linkText }>SERVICES</div>
                </Link>
                <Link style={links} to='/projects'>
                    <div style={ linkText }>PROJECTS</div>
                </Link>
                <Link style={links} to='/contact'>
                    <div style={ linkText }>CONTACT</div>
                </Link>
            </ul>
        </nav>
    );
}

export default BottomNav;
